SET statement_timeout = 0;
SET lock_timeout = 0;
SET idle_in_transaction_session_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SELECT pg_catalog.set_config('search_path', '', false);
SET check_function_bodies = false;
SET client_min_messages = warning;
SET row_security = off;

CREATE EXTENSION IF NOT EXISTS plpgsql WITH SCHEMA pg_catalog;
COMMENT ON EXTENSION plpgsql IS 'PL/pgSQL procedural language';

SET default_tablespace = '';
SET default_with_oids = false;

CREATE TABLE public.region (
    name CHARACTER VARYING(255) NOT NULL,
    population FLOAT NOT NULL,
    unemployment FLOAT NOT NULL,
    employment FLOAT NOT NULL,
    potential_labor_force FLOAT NOT NULL,
    salary FLOAT NOT NULL,
    education_school FLOAT NOT NULL,
    education_high FLOAT NOT NULL,
    crimes FLOAT NOT NULL,
    life_quality FLOAT NOT NULL,
    house_afford FLOAT NOT NULL,
    vrp_2014 FLOAT NOT NULL,
    vrp_2015 FLOAT NOT NULL,
    vrp_2016 FLOAT NOT NULL,
    vrp_2017 FLOAT NOT NULL,
    vrp_2018 FLOAT NOT NULL,
    vrp_2019 FLOAT NOT NULL,
    investment_msu FLOAT NOT NULL,
    result FLOAT DEFAULT NULL
);

ALTER TABLE public.region OWNER TO current_user;

